    // Core update
    void VOCAL_TRACT::update(){    
        ud_x_update();
        set_x(_ud_x);
        ud_o_update();
        set_o(_ud_o);
        Gnl_update();
        Fnl_update();
        res_Fnl_update();    
        unsigned int iter_res_Fnl = 0;
        _step_Fnl = 1;

        // Header for log file
        FID_log_shp << "iter \t\t resF \t\t stepF \t\t det \t\t cond" << endl;

        while ((iter_res_Fnl<20) & (res_Fnl()>2.220446049250313e-16) & (step_Fnl()>2.220446049250313e-16)){    
            save_Fnl_update();
            jacGnlnl_update();
            jacFnl_update();
            ijacFnl_update();
            ud_vnl_update();
            set_vnl(_ud_vnl);
            Gnl_update();
            Fnl_update();
            res_Fnl_update();
            step_Fnl_update();iter_res_Fnl += 1;


            // logging infos
            // JacobiSVD<MatrixXd> svd(_jacFnl);
            // double cond = svd.singularValues()(0) / svd.singularValues()(svd.singularValues().size()-1);
            FID_log_shp << iter_res_Fnl 
              << "\t\t" << _res_Fnl 
              << "\t\t" << _step_Fnl 
              << "\t\t" << _jacFnl.determinant()
              // << "\t\t" << cond
              << endl;
        } // end of while
        dxH_update();
        z_update();
        y_update();
    }
